import React from 'react';

class StorePrices extends React.Component {
    const = Object.keys(this.props.prices);
    render() { 

        return (

            <div className="store">
                <h2 className={`h2 ${this.props.prices}`}>{this.props.storeName}</h2>
                <table>
                    <caption class="offscreen">{this.props.storeName} Prices</caption>
                    <tr>
                        <th>Price per lb</th>
                        <th>Unit Price</th>
                        <th>Quantity</th>
                    </tr>
                </table>
          </div>
        );
    }

}

export default StorePrices;
